// SPDX-License-Identifier: MIT

pragma solidity ^0.8.1;

contract Product {

    //Creating the reference data for harvest of produce
    struct harvestProduce {
        uint            productID;
        address payable farmerAddress;
        string          photoHash;
        uint            harvestCaptureTime;
        string          cropName;
        uint            PHLevel;
        uint            ECLevel;
        uint            waterLevel;
        uint            harvestDate;
        uint            estimatedMonthlyVolume;
        chemical        usedChemicals;
    }

    //Creating the reference data for chemical used in harvestProduce
    struct chemical {
        string  chemical;
        uint chemicalsDate; 
    }

    //Creating the reference data for storage of produce
    struct storageProduce {
        uint    quantity;
        uint    storageCaptureTime;
        string  hashID;
        uint    weight;
        uint    price;
        uint    packingTimeStamp;
        uint    packingDate; 
        uint    expiryDate;
    }

    //Creating the reference data for order
    struct order {
        uint    orderID;
        uint    productID;
        uint    quantity;
        uint    totalPrice;
        uint    distributorID;
        address distributorAddress;
        uint    farmerID;
        Carrier carrier;
        bool    IsCarrierInvtied;
        bool    isCompleted;
        uint    isAccepted; // 0 = pending / 1 = accepted / 2 = rejected
        bool    isCancelled;
    }
    // Need Implementation
    struct Carrier {
        string  companyName;
        uint    carPlateNumber;
        address    carrierAddress;
        bool       invitationAccepted;
    }


    event registeredHarvestEvent (
        uint indexed _harvestID
    );

    event registeredStorageEvent (
        uint indexed _storageID
    );

    event newOrderEvent (
        uint indexed _orderID
    );

    event orderAcceptedEvent (
        uint indexed _orderID,
        uint orderStatus,
        string notes
    );

    event orderCompetedEvent (
        uint indexed _orderID
    );

    event CarrierInvitation (
        uint indexed _orderID,
        address carrierAddress
    );

    event CarrierInvitationAccepted (
        uint indexed _orderID,
        address carrierAddress
    );


    //mapping of all the produce harvested
    mapping(uint => harvestProduce) public harvestMapping;
    uint public  harvestCounter;

    //mapping of all the produce storage
    mapping(uint => storageProduce) public storageMapping;
    uint public storageCounter;

    mapping(uint => order) public ordersMapping;
    uint public orderCounter;

    

    //Registering a harvest instance
    function registerHarvest(string memory _photoHash,
                             uint _harvestCaptureTime,
                             string memory _cropName,
                             uint _PHLevel,
                             uint _ECLevel,
                             uint _waterLevel,
                             uint _harvestDate,
                             uint _estimatedMonthlyVolume,
                             string memory chemicalName,
                             uint chemicalDate
                             ) public {


        harvestProduce memory tmp = harvestProduce(harvestCounter,payable(msg.sender),_photoHash, _harvestCaptureTime,_cropName,_PHLevel,_ECLevel, _waterLevel,_harvestDate, _estimatedMonthlyVolume,chemical(chemicalName,chemicalDate));
        
        harvestMapping[harvestCounter] = tmp;
        emit registeredHarvestEvent(harvestCounter);
        harvestCounter++;
    }

    //Registering a storage instance
    function registerStorage(uint _quantity,
                             uint  storageCaptureTime,
                             string memory  _hashID,
                             uint _weight,
                             uint _price,
                             uint _packingTimeStamp,
                             uint _packingDate,
                             uint _expiryDate
                            ) public {
        
        storageProduce memory tmp = storageProduce(_quantity,storageCaptureTime,_hashID, _weight,_price,_packingTimeStamp,_packingDate, _expiryDate);
        storageMapping[storageCounter] = tmp;
        emit registeredHarvestEvent(storageCounter);
        storageCounter++;
        // trigger registeredStorage event
        emit registeredStorageEvent(storageCounter);
    }

    // Placing order by the distributor
    function placeOrder(uint _orderID,uint _productID,uint _quantity,uint _totalPrice,uint _distributorID, uint _farmerID) public{

        // set order isCompleted to false by defualt, 
        //where there will be another function to mark order as completed from both parties farmer and distributor
        ordersMapping[orderCounter] = order( _orderID, _productID, _quantity, _totalPrice, _distributorID,msg.sender,  _farmerID,Carrier("",0,address(0x0),false), false,false,0,false);
        emit newOrderEvent(orderCounter);
        orderCounter++;
    }

    // Function for the distributor to be able to adjust qunantiy or price after getting rejected from farmer

    // function adjustOrder(uint _orderID,uint _quantity,uint _totalPrice) public {
    //     require(ordersMapping[_orderID].distributorAddress == msg.sender, "You are not authorized to adjust order");
    //     require(!ordersMapping[_orderID].isAccepted, "You can't adjust accepted orders, Contact your farmer");
    //     require(ordersMapping[_orderID].isCancelled, "You can't adjust accepted orders, Your order is cancelled");

    //     ordersMapping[_orderID].quantity = _quantity;
    //     ordersMapping[_orderID].totalPrice = _totalPrice;

    // }
    // Function foir the disturbutor to able to cancel the order before it get accepted by the farmer while it's pending
    function cancelOrder(uint _orderID) public {
    require(ordersMapping[_orderID].distributorAddress == msg.sender, "You are not authorized to adjust order");

    require(ordersMapping[_orderID].isAccepted == 0, "You can't cancel accepted orders, Contact your farmer");

    ordersMapping[_orderID].isCancelled = true;
    }

    // Set order as complete by distributor and check if the transaction came from distributor address
    function setOrderCompleted(uint _orderID) public {
        require(msg.sender == ordersMapping[_orderID].distributorAddress, "You are not authorized to set order as completed");
        require(ordersMapping[_orderID].isAccepted == 0, "You can't adjust orders that are not accepted, Contact your farmer");
        require(ordersMapping[_orderID].isCancelled, "You can't set order completed, Your order is cancelled");


        ordersMapping[_orderID].isCompleted = true;
        emit orderCompetedEvent(_orderID);

    }

    // Set order as accepted by farmer and check if the transaction came from farmer address
    function changeOrderStatus(uint _orderID, uint status, string memory reason) public {
        require(msg.sender == harvestMapping[ordersMapping[_orderID].productID].farmerAddress, "You are not authorized to set order as accepted");
        require(!ordersMapping[_orderID].isCompleted, "You can't change the status of the order after getting marked completed");
        ordersMapping[_orderID].isAccepted = status;
        emit orderAcceptedEvent(_orderID, status, reason);

    }

    function inviteCarrier(uint _orderID, address _carrierAdress) public {
        require(msg.sender == ordersMapping[_orderID].distributorAddress, "You are not authorized to invite carriers");
        require(ordersMapping[_orderID].IsCarrierInvtied == false, "Carrier Already Invited");

        ordersMapping[_orderID].IsCarrierInvtied = true;
        ordersMapping[_orderID].carrier.carrierAddress = _carrierAdress;

        emit CarrierInvitation(_orderID, _carrierAdress);

    }

    function acceptCarrierInvitation(uint _orderID, uint _carPlateNumber, string memory _companyName) public {
        require(ordersMapping[_orderID].carrier.carrierAddress == msg.sender, "You can't accept this invitation, You do not have any active invitations");
        require(ordersMapping[_orderID].carrier.invitationAccepted == false, "You already accepted the invitation");


        ordersMapping[_orderID].carrier.invitationAccepted = true;
        ordersMapping[_orderID].carrier.carPlateNumber = _carPlateNumber;
        ordersMapping[_orderID].carrier.companyName = _companyName;

        emit CarrierInvitationAccepted(_orderID, msg.sender);
    }

    //Checks the number of harvests in the harvestMapping
    function noHarvests() public view returns (uint){
        return harvestCounter;
    }
    //Checks the number of produce in the storageMapping
    function noStorage() public view returns (uint){
        return storageCounter;
    }
    // Check the number of orders in ordersMapping
    function noOrders() public view returns (uint) {
        return orderCounter;
    }
}
